Ragyo uses the power of her Shinra-Koketsu to negate the effects of everyone's Kamui and Goku Uniforms before reviving the original Life Fiber. Ragyo attempts to fuse everyone into the original Life Fiber, but Senketsu, acting on his own, manages to deal damage to Ragyo, restoring everyone's power and allowing the Elite Four and Nudist Beach to destroy the satellite uplink while Ryuko and Satsuki deal a critical blow to Ragyo. However, Nui and Ragyo combine together with the original Life Fiber, transforming into a giant rocket which launches into space so she can activate the satellite directly. Ryuko absorbs the combined power of Senketsu, Junketsu, and the Goku Uniforms to form Senketsu Kisaragi, launching into space and fight Ragyo, willingly taking her attacks to provide Senketsu with the power needed to eliminate all Life Fibers. After Ragyo destroys her own heart, Senketsu uses the last of his strength to return Ryuko safely to Earth, where she reunites with her friends and family. With the world freed from the threat of Life Fibers, Ryuko begins a new life with Mako and Satsuki, keeping the memory of Senketsu in her heart.
